A simple method for it is to burn sage & you can get that at any
holistic or new age type of store. Probably even e-bay might have some
on the site to buy. The important part about suing the sage wand is the
smoke although if you have asthma you can buy sage oil and anoint your
wrists and pulse points.

I personally prefer a mix of different incenses that I grind in my
mortar and pestle and burn them on a self starting charcoal. There are
some that think it does not work but I always notice either a decrease
or complete stop to activity after I use it.

Andrea

